import React, { useState } from 'react';
import FacebookLogin from 'react-facebook-login';
import { Navigate } from 'react-router-dom';


const FacebookLoginComponent = () => {
    const [redirectToSecurePage, setRedirectToSecurePage] = useState(false);

    const responseFacebook = (response) => {
      console.log(response);

      fetch('http://localhost:8000/user/auth/facebook', {
        credentials: 'include',
      })
          .then((response) => response.json())
          .then((data) => {
              console.log(data);

              if (data && data.secure_data) {
                  console.log("Good");
                  setRedirectToSecurePage(true);
              }
          })
          .catch((error) => {
              console.error('Error:', error);
          });
    };

    return (
        <div >
            <FacebookLogin
                appId="577978460649702"
                autoLoad={false}
                fields="name,email,picture"
                callback={responseFacebook}
                icon="fa-facebook"
                render={renderProps => (
                    <button onClick={renderProps.onClick}>This is my custom FB button</button>
                )}
            />
            {redirectToSecurePage && <Navigate to="/user" />}
        </div>
    );
};

export default FacebookLoginComponent;
